import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

class ChildMatchComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            match: props.match
        };
    }

    render() {
        let { match } = this.props;
        return (
            <React.Fragment>
                <Container>
                    <Row>
                        <Col>
        <h3>Team: {}</h3>
                        </Col>
                    </Row>
                </Container>
            </React.Fragment>
        );
    }
}

export default ChildMatchComponent;
